-- Scripts:

BSDARKTHEME.MouseButton1Down:Connect(function()
	for i, object in pairs(BLOODSCRIPT:GetDescendants()) do
		if object:IsA("TextButton") then
			if object.Parent.Name == "BSMenuTab" then
				object.BackgroundColor3 = Color3.fromRGB(15, 15, 15)
				object.BorderColor3 = Color3.fromRGB(30, 0, 50)
				object.TextColor3 = Color3.fromRGB(50, 0, 80)
				object.TextStrokeColor3 = Color3.fromRGB(30, 0, 50)
			elseif object.Parent.Name == "BSAdminFrame" then
				object.BackgroundColor3 = Color3.fromRGB(15, 15, 15)
				object.BorderColor3 = Color3.fromRGB(30, 0, 50)
				object.TextColor3 = Color3.fromRGB(50, 0, 80)
				object.TextStrokeColor3 = Color3.fromRGB(30, 0, 50)
			else
				object.BackgroundColor3 = Color3.fromRGB(10, 10, 10)
				object.BorderColor3 = Color3.fromRGB(57, 0, 95)
				object.TextColor3 = Color3.fromRGB(57, 0, 95)
				object.TextStrokeColor3 = Color3.fromRGB(57, 0, 95)
			end
		elseif object:IsA("TextLabel") then
			object.BackgroundColor3 = Color3.fromRGB(10, 10, 10)
				object.BorderColor3 = Color3.fromRGB(57, 0, 95)
				object.TextColor3 = Color3.fromRGB(57, 0, 95)
				object.TextStrokeColor3 = Color3.fromRGB(57, 0, 95)
		elseif object:IsA("ScrollingFrame") then
			object.BackgroundColor3 = Color3.fromRGB(15, 15, 15)
			object.BorderColor3 = Color3.fromRGB(57, 0, 95)
		elseif object:IsA("Frame") then
			object.BackgroundColor3 = Color3.fromRGB(15, 15, 15)
			object.BorderColor3 = Color3.fromRGB(57, 0, 95)
		elseif object:IsA("TextBox") then
			if object.Parent.Name == "BSAdminFrame" then
				object.BackgroundColor3 = Color3.fromRGB(15, 15, 15)
				object.BorderColor3 = Color3.fromRGB(30, 0, 50)
				object.TextColor3 = Color3.fromRGB(30, 0, 50)
				object.TextStrokeColor3 = Color3.fromRGB(30, 0, 50)
				object.PlaceholderColor3 = Color3.fromRGB(30, 0, 50)
			else
				object.BackgroundColor3 = Color3.fromRGB(10, 10, 10)
				object.BorderColor3 = Color3.fromRGB(57, 0, 95)
				object.TextColor3 = Color3.fromRGB(57, 0, 95)
				object.TextStrokeColor3 = Color3.fromRGB(57, 0, 95)
				object.PlaceholderColor3 = Color3.fromRGB(57, 0, 95)
			end
		end
	end
end)

