function looptelep()
    if lotptog == false then
        lotptog = true
        lotp.Text = "Loop-Teleport: ON"
        repeat
            game.Players.LocalPlayer.Character:MoveTo(game.Players:FindFirstChild(plr.Text).Character.PrimaryPart.Position)
            wait(0.001)
        until lotptog == false
    else
        lotptog = false
        lotp.Text = "Loop-Teleport: OFF"
    end
end
