			if not self.Selection.Selected[node.Obj] then
				self.Selection:Set({node.Obj})
			end
			self:Refresh()
		end)
		entry.MouseButton2Up:Connect(function()
			if rightEntry and f.checkMouseInGui(rightEntry) then
